settings\u0004Note: To disable a context:
Remarque : Pour désactiver un élément du menu contextuel,
copiez-le dans les préférences utilisateur et ajoutez l'attribut
"désactivé". L'exemple suivant désactivera le téléchargement de l'élément sur les fichiers:
{
  "contextMenu": [
    {
      "command": "filebrowser:download",
      "sélecteur": ". p-DirListing-item[data-isdir=\"false\"]",
      "disabled": true
    }
  ]
}

