settings\u0004Note: To disable a item,\n:
Remarque : Pour désactiver un élément,
copiez le dans les préférences utilisateur et ajoutez la touche
"désactivé". L'exemple suivant désactivera le menu utilisateur:
{
  "toolbar": [
    {
      "name": "user-menu",
      "disabled" : true
    }
  ]
}

Description de la barre supérieure :

settings\u0004Note: To disable a menu or:
Remarque : Pour désactiver un élément de menu ou un menu,
copiez-le dans les préférences utilisateur et ajoutez la touche
"disabled". L'exemple suivant désactivera
le menu "Onglet" et "Redémarrer le noyau et Exécuter jusqu'à la cellule sélectionnée"
élément :
{
  "menus": [
    {
      "id": "jp-mainmenu-tabulations",
      "désactivé": vrai
    },
    {
      "id": "jp-mainmenu-kernel",
      "items": [
        {
          "command": "notebook:restart-and-run-to-selected",
          "désactivé" : vrai
        }
      ]
    }
  ]
}

