settings\u0004Note: To disable a toolbar:
Remarque : Pour désactiver un élément de la barre d'outils,
copiez-le dans les préférences utilisateur et ajoutez l'attribut
"disabled". L'exemple suivant désactivera le bouton pour interrompre l'exécution:
{
  "toolbar": [
    {
      "name": "interrupt",
      "disabled": true
    }
  ]
}

Description de la barre d'outils :

Remarque : Pour désactiver un élément de la barre d'outils,
copiez-le dans les préférences utilisateur et ajoutez l'attribut
"disabled". L'exemple suivant désactivera le sélecteur du caractère de délimitation:
{
  "toolbar": [
    {
      "name": "delimiter",
      "disabled": true
    }
  ]
}

