settings\u0004Overrides default widget p:
Remplace la position par défaut du widget dans la disposition de l'application
par ex. pour positionner les terminaux dans la barre latérale droite en mode documents multiples et dans le bas sont en mode document unique, {
  "single": { "Terminal": { "area": "down" } },
  "multiple": { "Terminal": { "area": "right" }
}.
